			["borderBackdrop"] = "Blizzard Tooltip",
			["parent"] = "Interrupt Tracker",
			["customText"] = "function()\n    if aura_env.state and aura_env.state.expirationTime then\n        local timestamp=GetTime()\n        local prefix=\"\"\n        if timestamp < aura_env.state.expirationTime then\n            if aura_env.showCooldownText then\n                local cooldown=aura_env.state.expirationTime-timestamp\n                if aura_env.colorHighlightCooldown and cooldown<=3 then\n                    prefix=\"|cffffff00\"\n                end\n                return prefix..string.format(\"%.1f\",cooldown)..\"|r\"\n            end\n        else\n            if aura_env.showReadyText then\n                if aura_env.colorHighlightCooldown then\n                    prefix=\"|cff00ff00\"\n                end\n                return prefix..aura_env.readyText..\"|r\"\n            end\n        end\n    end\nend",
			["customTextUpdate"] = "update",
			["displayTextLeft"] = "%n",
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_type"] = "stateupdate",
						["buffShowOn"] = "showOnActive",
						["event"] = "Health",
						["names"] = {
						},
						["unit"] = "player",
						["custom"] = "function(allstates,event,...)\n    if event==\"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local subevent=select(2,...)\n        if subevent==\"SPELL_CAST_SUCCESS\" then\n            local spellId=select(12,...)\n            -- Merge spellIDs\n            if aura_env.spellAliases[spellId] then\n                spellId=aura_env.spellAliases[spellId]\n            end\n            \n            if aura_env.trackedSpells[spellId] then\n                local sourceGuid=select(4,...)\n                local sourceName=select(5,...)\n                \n                -- Merge pets with their owner\n                local type=strsplit(\"-\",sourceGuid)\n                if type==\"Pet\" then\n                    if UnitGUID(\"playerpet\")==sourceGuid then\n                        sourceName=UnitName(\"player\")\n                    else\n                        for i=1,GetNumGroupMembers()-1 do\n                            if UnitGUID(\"partypet\"..i)==sourceGuid then\n                                sourceGuid=UnitGUID(\"party\"..i)\n                                sourceName=UnitName(\"party\"..i)\n                                break\n                            end\n                        end\n                    end\n                end\n                \n                -- Create a reference to pass to several functions\n                local refStr\n                if UnitGUID(\"player\")==sourceGuid then\n                    refStr=\"player\"\n                else\n                    for i=1,GetNumGroupMembers()-1 do \n                        if UnitGUID(\"party\"..i)==sourceGuid then \n                            refStr=\"party\"..i\n                        end\n                    end\n                end\n                \n                local state\n                for i,s in ipairs(allstates) do\n                    if s.spellId==spellId and s.sourceGuid==sourceGuid then\n                        state=s\n                        break\n                    end\n                end\n                if not state then\n                    state={}\n                    state.refStr=refStr\n                    state.cooldown=aura_env.trackedSpells[spellId]\n                    state.duration=state.cooldown\n                    if aura_env.modifyingTalents[spellId] then\n                        if refStr then\n                            NotifyInspect(refStr)\n                        end\n                    end\n                    state.show=true\n                    state.sourceGuid=sourceGuid\n                    state.name=sourceName\n                    if aura_env.removeRealmNames then \n                        state.name=strsplit(\"-\",state.name)\n                    end\n                    state.spellId=spellId\n                    state.progressType='timed'\n                    state.autoHide=false\n                    state.resort=true\n                    state.icon=select(3,GetSpellInfo(spellId))\n                    state.index=state.duration\n                    if refStr then\n                        local playerclass=select(2,UnitClass(refStr))\n                        state.color=RAID_CLASS_COLORS[playerclass]\n                    end\n                    \n                    allstates[table.getn(allstates)+1]=state\n                end\n                state.expirationTime=GetTime()+state.cooldown\n                state.changed=true\n            end\n            return true\n        end\n    end\n    \n    -- Handle talents, which reduce cooldown\n    if event==\"INSPECT_READY\" then\n        local unitGuid=select(1,...)\n        for i,s in ipairs(allstates) do\n            if s.sourceGuid==unitGuid then\n                local modifyingTalent=aura_env.modifyingTalents[s.spellId]\n                if modifyingTalent then\n                    local talentId,selected\n                    for t=1,7 do\n                        for c=1,3 do\n                            talentId,_,_,selected=GetTalentInfo(t,c,GetActiveSpecGroup(true),true,s.refStr)\n                            if talentId==modifyingTalent.id then\n                                if selected then\n                                    s.cooldown=s.cooldown-modifyingTalent.cdr\n                                    s.duration=s.cooldown\n                                    s.expirationTime=s.expirationTime-modifyingTalent.cdr\n                                    s.index=s.duration\n                                    s.changed=true\n                                    return true\n                                end\n                            end\n                        end\n                    end\n                end\n            end\n        end\n    end\n    \n    -- Remove spell tracking for players who leave the group\n    if event==\"GROUP_ROSTER_UPDATE\" then\n        local used\n        for _,s in ipairs(allstates) do\n            used=false\n            if s.refStr==\"player\" then\n                used=true\n            else\n                for i=1,GetNumGroupMembers() do\n                    if s.sourceGuid==UnitGUID(\"party\"..i) then\n                        used=true\n                        break\n                    end\n                end\n            end\n            if not used then\n                s.show=false\n                s.changed=true\n            end\n        end\n        return true\n    end\n    \nend",
