						["custom"] = "function(_,_,type,_,sguid,_,_,_,_,name,_,_,spellID,spell)\n    if sguid == aura_env.pguid then\n        if type == \"SPELL_CAST_SUCCESS\" then\n            if spellID == 192083 or spellID == 192081 then\n                aura_env.Build(\"ironfur\")\n                return true\n            end\n        end\n        \n        if type == \"SPELL_AURA_APPLIED\" then\n            if spellID ==  213680 then\n                aura_env.ironfur.duration = 6 + (aura_env.traitCount_ursocs_endurance * 0.5) + 2\n            end\n        end\n        \n        if type == \"SPELL_AURA_REMOVED\" then\n            if spellID == 213680 then\n                aura_env.ironfur.duration = 6 + (aura_env.traitCount_ursocs_endurance * 0.5)\n            end\n        end\n    end\nend",
