				["init"] = {
					["custom"] = "-- set number of artifact points you have in Ursoc's Endurance\naura_env.traitCount_ursocs_endurance = 3\n-- aura naming\nlocal prefix = \"IF: \"\nlocal ironfur = \"Ironfur\"\naura_env.pguid = UnitGUID(\"player\")\naura_env.ironfur = {}\naura_env.ironfur.data = WeakAuras.GetData(prefix..ironfur)\naura_env.ironfur.name = ironfur\naura_env.ironfur.shortname = \"IF\"..ironfur:gsub('%W',''):lower()\naura_env.ironfur.duration = 6 + (aura_env.traitCount_ursocs_endurance * 0.5)\naura_env.ironfur.durationMax = 6 + (aura_env.traitCount_ursocs_endurance * 0.5) + 2\naura_env.ironfur.count = 0\n\n\naura_env.Build = function(demon)\n    aura_env[demon].count = aura_env[demon].count+1\n    local count = aura_env[demon].count\n    local durationMax = aura_env[demon].durationMax\n    local barName = aura_env[demon].shortname..\"Bar\"..count\n    if not _G[barName] then\n        _G[barName] = CreateFrame(\"StatusBar\",barName,WeakAuras.regions[aura_env.id].region)\n        local bar = _G[barName]\n        bar.name = barName\n        bar:SetHeight(aura_env[demon].data.height)\n        bar:SetWidth(aura_env[demon].data.width)\n        bar:SetPoint(\"TOPLEFT\",WeakAuras.regions[prefix..aura_env[demon].name].region,\"TOPLEFT\",0,0)\n        bar:SetFrameStrata(\"MEDIUM\")\n        \n        bar:SetStatusBarTexture(\"Interface/Buttons/WHITE8X8\")\n        bar.texture=bar:GetStatusBarTexture()\n        bar:SetBackdrop({bgFile = \"Interface/Tooltips/UI-Tooltip-Background\"})\n        bar:SetBackdropColor(0,0,0,0)\n        bar.duration = aura_env[demon].duration\n        bar:SetMinMaxValues(0, durationMax)\n        local spark = bar:CreateTexture(nil, \"ARTWORK\")\n        spark:SetDrawLayer(\"ARTWORK\", 3)\n        bar.spark = spark\n        bar.spark:SetTexture(aura_env[demon].data.sparkTexture)\n        bar.spark:SetWidth(aura_env[demon].data.sparkWidth)\n        bar.spark:SetHeight(aura_env[demon].data.sparkHeight)\n        bar.spark:SetPoint(\"CENTER\", bar, \"LEFT\", aura_env[demon].data.width, 0)\n        bar.spark:SetBlendMode(aura_env[demon].data.sparkBlendMode)\n        if count == 1 then\n            local bg = _G[barName]:CreateTexture(nil, \"LOW\", nil, -8)\n            bar.bg = bg\n            bar.bg:SetTexture(\"Interface/Buttons/WHITE8X8\")\n            local bgc = aura_env[demon].data.backgroundColor\n            bar.bg:SetVertexColor(bgc[1],bgc[2],bgc[3],bgc[4])\n            bar.bg:SetHeight(aura_env[demon].data.height)\n            bar.bg:SetWidth(aura_env[demon].data.width)\n            bar.bg:SetPoint(\"CENTER\", bar, \"CENTER\", 0, 0)\n        end\n    end\n    local bar = _G[barName]\n    -- these need to be set again on each Imp spawn\n    bar:SetFrameLevel(count>1000 and 0 or 1000-count)\n    bar.level = bar:GetFrameLevel()\n    bar.deUp = false\n    bar.expires = GetTime()+aura_env[demon].duration\n    bar:SetValue(aura_env[demon].duration)\n    local bc = aura_env[demon].data.barColor\n    aura_env.SetGradient(bar,bc,\"build----\")\n    bar.spark:SetPoint(\"CENTER\", bar, \"LEFT\", aura_env[demon].data.width, 0)\n    local sparkColor = aura_env[demon].data.sparkColor\n    bar.spark:SetVertexColor(sparkColor[1], sparkColor[2], sparkColor[3], sparkColor[4])\n    bar:Show()\nend\naura_env.SetGradient = function(bar,bc,...)\n    --print(string.format(\"\\124cFF%02x%02x%02x\", bc[1]*255, bc[2]*255, bc[3]*255),bar.name,...)\n    bar.texture:SetGradientAlpha(\"HORIZONTAL\",bc[1]*0.9,bc[2]*0.9,bc[3]*0.9,0.9,bc[1]*1.2,bc[2]*1.2,bc[3]*1.2,1)\nend\n\naura_env.RemoveBar = function(demon)\n    local count = aura_env[demon].count\n    for i=count,1,-1 do\n        _G[aura_env[demon].shortname..\"Bar\"..count].expires=GetTime()\n        local bc = aura_env[demon].data.barColor\n        aura_env.SetGradient(_G[aura_env[demon].shortname..\"Bar\"..count],bc,\"remove\")\n    end\nend\n\naura_env.Update = function(demon)\n    local count = aura_env[demon].count or 0\n    if count > 0 then\n        for i=1,count,1 do\n            local bar = _G[aura_env[demon].shortname..\"Bar\"..i]\n            if bar then\n                local expires = bar.expires\n                local countdown = expires-GetTime()\n                if expires and countdown > 0 then\n                    bar:SetValue(countdown)\n                    bar.spark:ClearAllPoints()\n                    local x = (countdown/aura_env[demon].durationMax)*aura_env[demon].data.width\n                    bar.spark:SetPoint(\"CENTER\", bar, \"LEFT\", x, 0);\n                    --if countdown < 0.019 then print(bar.name,\"end\") end\n                else\n                    for j=count-1,1,-1 do\n                        \n                        local nextExpires = _G[aura_env[demon].shortname..\"Bar\"..(count-j+1)].expires\n                        _G[aura_env[demon].shortname..\"Bar\"..(count-j)].expires = nextExpires\n                        local nextDeUp = _G[aura_env[demon].shortname..\"Bar\"..(j+1)].deUp\n                        _G[aura_env[demon].shortname..\"Bar\"..(j)].deUp = nextDeUp\n                        local newFrameLevel =  _G[aura_env[demon].shortname..\"Bar\"..(j)]:GetFrameLevel()\n                        _G[aura_env[demon].shortname..\"Bar\"..(j)]:SetFrameLevel(newFrameLevel)\n                        local bc = {}\n                        local deUp = _G[aura_env[demon].shortname..\"Bar\"..(j)].deUp\n                        if deUp then\n                            bc = aura_env.de.data.barColor\n                        else\n                            bc = aura_env[demon].data.barColor\n                        end\n                        \n                        aura_env.SetGradient(_G[aura_env[demon].shortname..\"Bar\"..(j)],bc,\"update\",j+1,\"deUp\",deUp,nextDeUp)\n                    end\n                    _G[aura_env[demon].shortname..\"Bar\"..(count)]:Hide()\n                    aura_env[demon].count = count -1\n                    \n                end\n            end\n        end\n    end\n    _G[\"WA_OOMM_\"..demon:upper()..\"_COUNT\"] = aura_env[demon].count\nend",
