					["custom"] = "aura_env.keystone = nil\naura_env.linkKey = function(channel)\n    channel = channel or \"PARTY\"\n    if aura_env.keystone == nil then aura_env.updateKey() end\n    SendChatMessage(aura_env.keystone, channel)\nend\n\naura_env.updateKey = function()\n    for bag = 0, NUM_BAG_SLOTS do\n        local numSlots = GetContainerNumSlots(bag)\n        for slot = 1, numSlots do\n            if (GetContainerItemID(bag, slot) == 158923) then\n                local link = GetContainerItemLink(bag, slot)\n                aura_env.keystone = link\n                return\n            end\n        end\n    end\nend\n\naura_env.updateKey()\n\nlocal config = aura_env.config\n\nlocal allTypes = {\"enablePARTY\", \"enableGUILD\", \"enablePARTYLEADER\"}\n\naura_env.types = {}\nfor _,type in ipairs(allTypes) do\n    if config[\"enabled\"..type] then\n        aura_env.types[type] = true\n    end\nend",
